import { Responsive as ResponsiveGridLayout } from "react-grid-layout";
import GridLayout from "react-grid-layout";
import "./style.css";
export const Layoutgrid = () => {
  // {lg: layout1, md: layout2, ...}
  const layout = [
    { i: "a", x: 0, y: 0, w: 2, h: 2 },
    { i: "b", x: 1, y: 0, w: 1, h: 2 },
    { i: "c", x: 4, y: 0, w: 1, h: 2, moved: false },
  ];
  const layout2 = [
    { i: "a", x: 0, y: 1, w: 2, h: 2 },
    { i: "b", x: 1, y: 1, w: 1, h: 2 },
    { i: "c", x: 2, y: 0, w: 1, h: 2, moved: false },
  ];
  return (
    <>
    <div style={{display:"flex",width:"100%"}}></div>
      <GridLayout
        className="layout"
        style={{ backgroundColor: "white" }}
        layout={layout}
        cols={1}
        rowHeight={40}
        width={200}
      >
        <div style={{ backgroundColor: "blue" }} key="a">
          a
        </div>
        <div style={{ backgroundColor: "black" }} key="b">
          b
        </div>
        <div style={{ backgroundColor: "red" }} key="c">
          c
        </div>
      </GridLayout>

      <GridLayout
        className="layout"
        style={{ backgroundColor: "white" }}
        layout={layout2}
        cols={1}
        rowHeight={40}
        width={200}
      >
        <div style={{ backgroundColor: "blue" }} key="a">
          a
        </div>
        <div style={{ backgroundColor: "black" }} key="b">
          b
        </div>
        <div style={{ backgroundColor: "red" }} key="c">
          c
        </div>
      </GridLayout>
    </>
  );
};
